Parse function for rows.
Example:
    const r = await parseFile('a,b,c\ne,f,g\n', {
     header: ["this", "is", "sparta"],
      parse: (e: Record<string, unknown>) => {
        return { super: e.this, street: e.is, fighter: e.sparta };
      }
    });
